  \nExample\n\nInput\n\n\n3\n2 4 3\na*\n4 1 3\na**a\n6 3 20\n**a***\n\n\nOutput\n\n\
  \nabb\nabba\nbabbbbbbbbb\n\nNote\n\nIn the first testcase of the example, BA-strings\
